import axios from 'axios';

const baseUrl = 'https://api.unsplash.com/';
const apiKey = 'a2vi9wALahTlm3vNi9SQfTPRNtoWjZoWsHVZwfsYokE';

export const getCityImage = async (image) => {
  try {
    console.log(
      `https://api.unsplash.com/photos/?q=${image}&appid=${apiKey}`
    );
    const response = await axios.get(baseUrl + `q=${image}&appid=${apiKey}`);



    console.log('data', response.data);
    return response.data;
  } catch (error) {
    throw error;
  }
};
